import './App.css';
import './assets/bootstrap.css'
import Table from './components/table';
import Item from './components/item';
import img1 from './assets/img/pic1.jpg'
function App() {
  return (
 <>
    <h1> שלום לכולם </h1>
    <Table></Table>
    <Item img={img1} name={"חנוכיה"} pric={90}></Item>
    </>
  );
}

export default App;
